import {useState} from 'react';

export default function SearchBar({onSearch}) {
   const [id, setId] = useState('');


   return (
      <div>
         <input type='search' />
         <button onClick={(characterID)=>{onSearch(characterID)}}>Agregar</button>
      </div>
   );
   }
